@font-face {
    font-family: "iconfont"; /* Project id 4088881 */
    src: url('iconfont.woff2?t=1690027520418') format('woff2'),
         url('iconfont.woff?t=1690027520418') format('woff'),
         url('iconfont.ttf?t=1690027520418') format('truetype');
  }
  
  .iconfont {
    font-family: "iconfont" !important;
    font-size: 16px;
    font-style: normal;
    -webkit-font-smoothing: antialiased;
    -moz-osx-font-smoothing: grayscale;
  }
